 null, \'a:0:{}\', null, null, \'\', \'0\', \'0\', \'1375862712\');'), ('INSERT INTO `go_article` VALUES (\'7\', \'4\', \'author\', \'商品配送\', null, null, \'a:0:{}\', null, null, \'\', \'0\', \'0\', \'1375862725\');'), ('INSERT INTO `go_article` VALUES (\'8\', \'4\', \'author\', \'配送费用\', null, null, \'a:0:{}\', null, null, \'\', \'0\', \'0\', \'1375862737\');'), ('INSERT INTO `go_article` VALUES (\'9\', \'4\', \'author\', \'商品验货与签收\', null, null, \'a:0:{}\', null, null, \'\', \'0\', \'0\', \'1375862747\');'), ('INSERT INTO `go_article` VALUES (\'10\', \'4\', \'author\', \'长时间未收到商品\', null, \'\', \'a:0:{}\', null, null, \'\', \'0\', \'0\', \'1375862760\');'), ('INSERT INTO `go_article` VALUES (\'12\', \'3\', \'author\', \'隐私声明\', \'\', \'\', \'a:0:{}\', \'\', \'\', \'<p>'), ('INSERT INTO `go_article` VALUES (\'13\', \'16\', \'author\', \'基金的建立\', \'\', \'\', \'a:0:{}\', \'基金的建立\', \'云购基金是YunGouCMS — 惊喜无线创始人发起成立的以公益事业为主要方向的爱心基金。云购基金本着“我为人人，人人为我”的社会责任，向需要帮助的困难人们提供爱心捐助。\', \'<p>云购基金是YunGouCMS — 惊喜无线创始人发起成立的以公益事业为主要方向的爱心基金。云购基金本着“我为人人，人人为我”的社会责任，向需要'), ('INSERT INTO `go_article` VALUES (\'14\', \'16\', \'author\', \'基金的筹备办法\', \'\', \'\', \'a:0:{}\', \'基金的筹备办法\', \'每位在YunGouCMS — 惊喜无线进行分享购物的朋友，您的每次参与都将是为我们的公益事业做出一份贡献。当您每参与1人次云购，将由1元云购出资为云购基金筹款0.01元，所筹款项将全部用于云购基金。\', \'<p>每位在YunGouCMS — 惊喜无线进行分享购物的朋友，您的每次参与都将是为我们的公益事业做出一份贡献。'), ('INSERT INTO `go_article` VALUES (\'15\', \'16\', \'author\', \'基金的去向\', \'\', \'\', \'a:0:{}\', \'基金的去向\', \'云购基金将会以第1种途径或第2种途径进行使用：\\n1、YunGouCMS — 惊喜无线全体员工将组织向身边的公益事业进行捐赠与关怀活动。活动内容包括：资金、所需用品以及探望与协助等，每次捐赠与关怀活动结束后云购基金将公布活动详情以及基金详细使用报告。\\n2、云购基金通过腾讯公益或壹基金等公益组织进行爱心捐赠。\', \'<p>云'), ('INSERT INTO `go_article` VALUES (\'16\', \'142\', \'author\', \'云购CMS v4新版震撼发布\', \'\', \'\', \'a:0:{}\', \'云购CMS v4新版震撼发布\', \'云购CMS v4新版震撼发布\', \'<p>亲爱的云友：<br/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;大家好！<img src=\\http://skin.1yyg.com/Images/Emoticons/0.gif\\ alt=\\\\/>为提升网络稳定性，'), ('INSERT INTO `go_article` VALUES (\'17\', \'142\', \'author\', \'关于世锦赛、大阅兵期间配送延迟公告\', \'\', \'photo/20150920/66676293734257.jpg\', \'a:4:{i:0;s:33:\\photo/20150920/42197520734143.jpg\\;i:1;s:33:\\photo/20150920/72957300734145.jpg\\;i:2;s:33:\\photo/20150920/29439904734148.j'), ('INSERT INTO `go_article` VALUES (\'18\', \'142\', \'author\', \'2015年1元云购端午放假通知\', \'\', \'\', \'a:0:{}\', \'2015年1元云购端午放假通知\', \'亲爱的云友： 大家好！端午节终于来啦！根据国家法定节假日规定，1元云购2015年端午节放假安排如下： 6月20日（周六）至6月22日（周一）放假（共3天），6月23日（星期二）正常上班。 放假期间揭晓的商品，6月23日正式上班后第一时间安排发出，期间您若有疑问可直接致电400-850'), ('INSERT INTO `go_article` VALUES (\'19\', \'142\', \'author\', \'关于暴雨天气导致配送延迟公告\', \'\', \'\', \'a:0:{}\', \'关于暴雨天气导致配送延迟公告\', \'亲爱的云友： 大家好！近期，由于大范围暴雨天气的影响，部分地区物流配送有所延迟，如果您在1元云购网获得的商品未能及时送达，请您耐心等待，我们会尽最大努力，尽快为您送达，有疑问也可致电400-850-8080，我们将竭诚为您解答！ 由此带来的不便，敬请谅解！ 感谢您一直以来的信任与支持，祝'), ('INSERT INTO `go_article` VALUES (\'20\', \'142\', \'author\', \'本云购程序版权证明文件！打击盗版！\', \'color:#FF0000;\', \'\', \'a:0:{}\', \'本云购程序版权证明！计算机软件著作权！\', \'\', \'<p>'), ('INSERT INTO `go_article` VALUES (\'21\', \'146\', \'\', \'官方微信\', \'\', \'\', \'a:0:{}\', \'\', \'\', \'<p style=\\text-align: center;\\><img src=\\http://www.oo17.cn/statics/uploads/shopimg/20160221/30041439038927.jpg\\ title=\\qrcode_for_gh_f4df33de90f2_430.jpg\\/></p><p style='), (null), ('-- ----------------------------'), ('-- Table structure for `go_brand`'), ('-- ----------------------------'), ('DROP TABLE IF EXISTS `go_brand`;'), ('CREATE TABLE `go_brand` ('), ('  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,'), ('  `cateid` int(10) unsigned DEFAULT NULL COMMENT \'所属栏目ID\','), ('  `status` char(1) DEFAULT \'Y\' COMMENT \'显示隐藏\','), ('  `name` varchar(255) DEFAULT NULL,'), ('  `order` int(11) DEFAULT \'1\','), ('  PRIMARY KEY (`id`),'), ('  KEY `status` (`status`),'), ('  KEY `order` (`order`)'), (') ENGINE=MyISAM AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COMMENT=\'品牌表\';'), (null), ('-- ----------------------------'), ('-- Records of go_brand'), ('-- ----------------------------'), ('INSERT INTO `go_brand` VALUES (\'1\', \'5\', \'Y\', \'联想\', \'16\');'), ('INSERT I