></p>\', \'1\', \'92\', \'N\', \'N\', \'3\', \'1440337407\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'8\', \'1\', \'3\', \'今天的飞机又TM污点了，心难受啊~\', \'&lt;p&gt;南航天天延误航班，我真的是收不了了啊！我自己难受啊~&lt;br/&gt;&lt;/p&gt;\', \'0\', \'208\', \'Y\', \'N\', \'3\', \'1440337511\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'9\', \'1\', \'3\', \'你虽然你们来的早，但是没啥用的啊，你们迟早还得在回来呢~！\', \'<p>你虽然你们来的早，但是没啥用的啊，你们迟早还得在回来呢~！</p><p>我的电脑是自己买的，不是云购的~<br/></p>\', \'0\', \'54\', \'N\', \'N\', \'3\', \'1440337709\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'10\', \'2\', \'6\', \'大组织有大组织的好，当然也有大组织的失败，怎么办？\', \'<p>大组织有大组织的好，当然也有大组织的失败，怎么办？</p>\', \'1\', \'83\', \'N\', \'N\', \'6\', \'1440338491\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'11\', \'3\', \'9\', \'周末有没有一起出去玩的亲们呢！？\', \'周末有没有一起出去玩的亲们呢？？？\', \'0\', \'160\', \'Y\', \'N\', \'9\', \'1440339917\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'12\', \'1\', \'9\', \'老人站海滨浴场出口处 专撞女子胸部\', \'<p>【老人站海滨浴场出口处 专撞女子胸部】21日,网友“淮海游子d6qp7”上传了一段视频:一头发花白的老人站在一个海滨浴场的出口处,看似无意的抬起胳膊,不断撞向穿着泳衣走出来的女孩的胸部,而女孩们并未发觉不对</p>\', \'0\', \'58\', \'N\', \'N\', \'9\', \'1440340152\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'13\', \'2\', \'10\', \'原任中共中央副主席、中央顾问委员会委员汪东兴同志，因病医治无效，于2015年8月21日上午5时28分在北京逝世\', \'&lt;p&gt;汪东兴，1916年1月出生于江西省弋阳县，原中共中央副主席、中顾委委员。1932年加入中国共产党，随后参加了红军，历经长征与抗日战争，从1947\\n年开始一直担任毛泽东的警卫，并长期掌管8341部队。1968年起担任中共中央办公厅主任兼中央警卫局党委第一书记，并'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'14\', \'6\', \'10\', \'上海现在又下雨了，听天下啊！\', \'<p>上海现在又下雨了，听天下啊！</p>\', \'1\', \'77\', \'N\', \'N\', \'10\', \'1440340763\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'15\', \'3\', \'20\', \'贵圈真心乱，不是我们外行人可以理解的呢~\', \'<p>什么玩意啊！竟然不能粘贴呢~！<br/></p>\', \'0\', \'263\', \'N\', \'N\', \'20\', \'1440384741\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'16\', \'1\', \'14\', \'习近平致信祝贺第二十二届国际历史科学大会开幕\', \'央视网消息 第二十二届国际历史科学大会23日在山东济南开幕。国家主席习近平发来贺信，向会议的召开表示热烈的祝贺，向国际历史学会主席玛丽亚塔·希耶塔拉女士等与会的历史学家表示诚挚的欢迎 习近平在贺信中说，历史研究是一切社会科学的基础，承担着“究天人之际，通古今之变”的使命。重视历史、研究历史、借鉴历史，可以给人类带来很多了解昨天、把握今天、开创明'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'17\', \'5\', \'17\', \'天津港爆炸事故首批101名遇难者名单公布，中国5000多年的文明史，是自强不息的奋斗史\', \'<p>国务院副总理刘延东在开幕式上宣读了习近平的贺信并致辞。她指出，中国5000多年的文明史，是自强不息的奋斗史、追求和平的发展史、互学互鉴的交流史，\\n塑造了融入中华民族血脉的文化基因，形成了当代中国的价值理念、制度选择和发展道路。她希望各国学者交流对话、传承创新，加强国际学术合作，为促进多样文\\n明'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'18\', \'4\', \'274\', \'的骄傲辅导费\', \'<p>撒打发斯蒂芬阿斯顿发阿斯顿发阿萨德</p>\', \'0\', \'147\', \'N\', \'N\', \'274\', \'1449822121\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'19\', \'4\', \'615\', \'221\', \'<p>22121</p>\', \'0\', \'42\', \'N\', \'N\', \'615\', \'1456303705\');'), ('INSERT INTO `go_quanzi_tiezi` VALUES (\'20\', \'2\', \'615\', \'0.1\', \'<p>测试</p>\', \'0\', \'2\', \'N\', \'N\', \'615\', \'1458326399\');'), (null), ('-- ----------------------------'), ('-- Table structure for `go_recom`'), ('-- ----------------------------'), ('DROP TABLE IF EXISTS `go_recom`;'), ('CREATE TABLE `go_recom` ('), ('  `id` int(10) NOT NULL AUTO_INCREMENT COMMENT \'推荐位id\','), ('  `img` varchar(50) DEFAULT NULL COMMENT \'推荐位图片\','), ('  `title` varchar(30) DEFAULT NULL COMMENT \'推荐位标题\','), ('  `link` varchar(255) DEFAULT \'\' COMMENT \'链接地址\','), ('  PRIMARY KEY (`id`)'), (') ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;'), (null), ('-- ----------------------------'), ('-- Records of go_recom'), ('-- ----------------------------'), ('INSERT INTO `go_recom` VALUES (\'3\', \'banner/20150823/88514901333105.png\', \'首页跨栏广告\', \'goods_lottery\');'), ('INSERT INTO `go_recom` VALUES (\'4\', \'banner/20160328/31148918099700.jpg\', \'美女圈\', \'single/business\');'), (null), ('-- ----------------------------'), ('-- Table structure for `go_send`'), ('-- ----------------------------'), ('DROP TABLE IF EXISTS `go_send`;'), ('CREATE TABLE `go_send` ('), ('  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,'), ('  `uid` int(11) unsigned DEFAULT \'0\','), ('  `gid` int(11) unsigned DEFAULT \'0\' COMMENT \'商品ID\','), ('  `username` char(50) CHARACTER SET gbk DEFAULT \'\' COMMENT \'用户名\','), ('  `sho